import React, { useState, useEffect } from "react";
import GolfDataService from "../../services/golf";
import "./nextTournament.css";
import Container from "react-bootstrap";

function NextTournament() {
  const [nextTournament, setTournament] = useState({});

  useEffect(() => {
    getTournament();
  }, []);

  const getTournament = () => {
    GolfDataService.getNextTournament()
      .then((response) => {
        setTournament(response.data);
      })
      .catch((e) => {
        console.log(e);
      });
  };

  return (
    
      <div className="componentContainer">
        <h1>Next tournament..</h1>
        {nextTournament.Name}
        <Container>
          <Row>
            <Col>1 of 1</Col>
          </Row>
        </Container>
        <Container>
          <Row>
            <Col>1 of 1</Col>
          </Row>
        </Container>
      </div>
    
  );
}

export default NextTournament;
